import React, { useRef } from 'react';
import { useFormik } from 'formik';
import * as yup from 'yup';
import emailjs from '@emailjs/browser';
import styles from '../css/Contact.module.css';
import jimPhoto from '../assets/mainPics/jim.jpg';
import mbLogo from '../assets/mainPics/MB-logo.png';
import facebookLogo from '../assets/mainPics/Facebook_Logo_Primary.png';

const phoneRegExp =
  /^((\+[1-9]{1,4}[ \-]*)|(\([0-9]{2,3}\)[ \-]*)|([0-9]{2,4})[ \-]*)*?[0-9]{3,4}?[ \-]*[0-9]{3,4}?$/;

export default function Contact() {
  const formRef = useRef();

  const formik = useFormik({
    initialValues: {
      userFirstName: '',
      userLastName: '',
      userEmail: '',
      userPhoneNum: '',
      userMessage: '',
    },
    validationSchema: yup.object({
      userFirstName: yup
        .string()
        .max(25, 'Must be 25 characters or less')
        .required('Required'),
      userLastName: yup
        .string()
        .max(30, 'Must be 30 characters or less')
        .required('Required'),
      userEmail: yup.string().email('Invalid email').required('Required'),
      userPhoneNum: yup
        .string()
        .matches(phoneRegExp, 'Invalid phone number')
        .nullable(),
      userMessage: yup
        .string()
        .max(300, 'Must be 300 characters or less')
        .required('Required'),
    }),
    onSubmit: async (values, { setSubmitting, resetForm }) => {
      try {
        await emailjs.sendForm(
          'service_pda4dyn',
          'template_4npi60d',
          formRef.current,
          'JiyFMUBN4XcgzPCpE'
        );
        alert('Your message was sent successfully!');
        resetForm();
      } catch (err) {
        console.error(err);
        alert('Something went wrong. Please try again later.');
      } finally {
        setSubmitting(false);
      }
    },
  });

  const renderField = (name, label, type = 'text') => (
    <div className={styles.field}>
      <label htmlFor={name}>{label}</label>
      <input
        id={name}
        name={name}
        type={type}
        {...formik.getFieldProps(name)}
        aria-invalid={formik.touched[name] && formik.errors[name] ? 'true' : undefined}
        aria-describedby={formik.touched[name] && formik.errors[name] ? `${name}-error` : undefined}
      />
      {formik.touched[name] && formik.errors[name] ? (
        <div id={`${name}-error`} className={styles.error}>
          {formik.errors[name]}
        </div>
      ) : null}
    </div>
  );

  return (
    <section className={styles.contactSection}>
      {/* â€” Business card/sidebar */}
      <aside className={styles.businessCard}>
        <img src={jimPhoto} alt="Profile of James A. Stiltner" className={styles.profileImg} />
        <h2>James A. Stiltner</h2>
        <a href="tel:7199643526">719â€‘964â€‘3526</a>
        <a href="mailto:jim@masterbilt.com">jim@masterbilt.com</a>
      </aside>

      {/* â€” The form */}
      <div className={styles.formContainer}>
        <img src={mbLogo} alt="Masterbilt Logo" className={styles.logo} />
        <h1>Contact Us</h1>

        <form ref={formRef} onSubmit={formik.handleSubmit} noValidate>
          <div className={styles.row}>
            {renderField('userFirstName', 'First Name')}
            {renderField('userLastName', 'Last Name')}
          </div>
          <div className={styles.row}>
            {renderField('userEmail', 'Email', 'email')}
            {renderField('userPhoneNum', 'Phone', 'tel')}
          </div>
          <div className={styles.field}>
            <label htmlFor="userMessage">Message</label>
            <textarea
              id="userMessage"
              name="userMessage"
              rows="6"
              {...formik.getFieldProps('userMessage')}
              aria-invalid={formik.touched.userMessage && formik.errors.userMessage ? 'true' : undefined}
              aria-describedby={formik.touched.userMessage && formik.errors.userMessage ? 'userMessage-error' : undefined}
            />
            {formik.touched.userMessage && formik.errors.userMessage ? (
              <div id="userMessage-error" className={styles.error}>
                {formik.errors.userMessage}
              </div>
            ) : null}
          </div>

          <button
            type="submit"
            className={styles.submitBtn}
            disabled={formik.isSubmitting}
          >
            {formik.isSubmitting ? 'Sendingâ€¦' : 'Send Message'}
          </button>
        </form>

        {/* â€” Social links */}
        <div className={styles.socials}>
          <a
            href="https://www.facebook.com/MasterbiltHomes"
            target="_blank"
            rel="noopener noreferrer"
          >
            <img src={facebookLogo} alt="" />
            Visit Our Facebook Page
          </a>
          <a
            href="https://www.bbb.org/us/co/palmer-lake/profile/building-contractors/masterbilt-homes-0785-5281152/#sealclick"
            target="_blank"
            rel="noopener noreferrer"
          >
            <img
              src="https://seal-southerncolorado.bbb.org/seals/darkgray-seal-200-65-bbb-5281152.png"
              alt="BBB Rating"
            />
          </a>
        </div>
      </div>
    </section>
  );
}
